            sex={obj.sex}
            name={obj.name}
            text={obj.text}
            url={obj.url}
            rate={obj.rate}
          />
        );
      })}</div>

      <div className="recent-works">
        <div className="recent-works__container-big">
          <div className="recent-works__wrapper">
            <RecentWorks
              projects={projects}
              modal={modal}
              setModal={setModal}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReviewsPage;
